import React from 'react';
import { motion } from 'framer-motion';
import {
  Box,
  Container,
  Typography,
  Button,
  Grid,
  Card,
  CardContent,
  CardMedia,
  CardActions,
  Avatar,
} from '@mui/material';
import { styled } from '@mui/material/styles';

const HeroSection = styled(Box)(({ theme }) => ({
  height: '80vh',
  background: 'linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url("https://images.unsplash.com/photo-1589963463295-81f6ae08fc5c?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80")',
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  display: 'flex',
  alignItems: 'center',
  color: 'white',
  textAlign: 'center',
}));

const IntroSection = styled(Box)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'row',
  justifyContent: 'space-between',
  alignItems: 'center',
  padding: theme.spacing(4, 0),
}));

const StyledCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-10px)',
  },
}));

const featuredTours = [
  {
    title: 'Historic Valletta Walk',
    description: 'Explore the historic capital of Malta with Stanley, discovering hidden gems and fascinating stories.',
    image: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
  },
  {
    title: 'Secrets of Mdina',
    description: 'Discover the ancient walled city and its surroundings with Stanley\'s expert guidance.',
    image: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
  },
  {
    title: 'Three Cities Tour',
    description: 'Experience the authentic side of Malta through its historic Three Cities.',
    image: 'https://images.unsplash.com/photo-1596462502278-27bfdc403348?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=2070&q=80',
  },
];

function Home() {
  return (
    <Box>
      <HeroSection>
        <Container maxWidth="md">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <Typography variant="h2" component="h1" gutterBottom>
              Explore Malta with Stanley â€“ Where Every Step Tells a Story
            </Typography>
            <Typography variant="h5" paragraph>
              Private, unforgettable walking tours by a local expert
            </Typography>
            <Button
              variant="contained"
              color="secondary"
              size="large"
              sx={{ mt: 2 }}
              component="a"
              href="tours"
            >
              See All Tours
            </Button>
          </motion.div>
        </Container>
      </HeroSection>

      <Container sx={{ py: 8 }}>
        <IntroSection>
          <Box sx={{ flex: 1 }}>
            <Typography variant="h4" gutterBottom>
              Meet Stanley
            </Typography>
            <Typography variant="body1" paragraph>
              Stanley Cassar Darien is a passionate Maltese tour guide with 20+ years of experience. From historic landmarks to hidden gems, Stanley brings Malta's rich past to life through fun, private walking tours.
            </Typography>
          </Box>
          <Avatar
            alt="Stanley Cassar Darien"
            src="/stanley.jpg"
            sx={{ 
              width: 150, 
              height: 150,
              border: '3px solid white',
              boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
            }}
          />
        </IntroSection>
        <Typography variant="h5" align="center" sx={{ fontStyle: 'italic', mt: 4 }}>
          "Knowledgeable, passionate, and always ready with a good joke."
        </Typography>
      </Container>

      <Container sx={{ py: 8 }}>
        <Typography variant="h4" component="h2" align="center" gutterBottom>
          Featured Tours
        </Typography>
        <Grid container spacing={4}>
          {featuredTours.map((tour, index) => (
            <Grid item key={index} xs={12} sm={6} md={4}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.2 }}
              >
                <StyledCard>
                  <CardMedia
                    component="img"
                    height="200"
                    image={tour.image}
                    alt={tour.title}
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="h3">
                      {tour.title}
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      {tour.description}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button size="small" color="primary" href="/book">
                      Book Now
                    </Button>
                  </CardActions>
                </StyledCard>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
}

export default Home;
